import React, { useState } from 'react'
import "./RegisterForm.css";
import { loginUser, registerUser } from '../../services/authService';
import { useHistory, useNavigate } from "react-router-dom";

const RegisterForm = () => {

    const navigate = useNavigate();

    const [isAuthenticated, setIsAuthenticated] = useState(false);

    const [credentialsRegister, setCredentialsRegister] = useState({
        first_name: "",
        last_name: "",
        email: "",
        password: ""
      });

      const handleSubmitRegister = async (e) => {
        e.preventDefault();

        const data = await registerUser(credentialsRegister);

        setCredentialsRegister({
            first_name: "",
            last_name: "",
            email: "",
            password: ""
          })
          navigate('/login');
      }

      const [credentialsLogin, setCredentialsLogin] = useState({
        email: "",
        password: ""
      });

      const handleSubmitLogin = async (e) => {
        e.preventDefault();

        const data = await loginUser(credentialsLogin);

        setIsAuthenticated(true);

        setCredentialsLogin({
            email: "",
            password: ""
        })
          if(isAuthenticated) {
            navigate('/cars');
          }
      }


  return (
    <div className='form-container'>
        <div class="main">  	
		<input type="checkbox" id="chk" aria-hidden="true" />

			<div class="signup">
				<form onSubmit={handleSubmitRegister}>
					<label for="chk" aria-hidden="true">Sign up</label>
					<input 
                    type="text" 
                    name="first_name" 
                    placeholder="First name" 
                    required='' 
                    onChange={({ target }) =>
                    setCredentialsRegister({ ...credentialsRegister, first_name: target.value })
                    }
                    />
                    <input 
                    type="text" 
                    name="last_name" 
                    placeholder="Last name" 
                    required='' 
                    onChange={({ target }) =>
                    setCredentialsRegister({ ...credentialsRegister, last_name: target.value })
                    }
                    />
					<input 
                    type="email" 
                    name="email" 
                    placeholder="Email" 
                    required='' 
                    onChange={({ target }) =>
                    setCredentialsRegister({ ...credentialsRegister, email: target.value })
                    }
                    />
					<input 
                    type="password" 
                    name="password" 
                    placeholder="Password" 
                    required='' 
                    onChange={({ target }) =>
                    setCredentialsRegister({ ...credentialsRegister, password: target.value })
                    }
                    />
					<button>Sign up</button>
				</form>
			</div>

			<div class="login">
				<form onSubmit={handleSubmitLogin}>
					<label for="chk" aria-hidden="true">Login</label>
					<input type="email" name="email" placeholder="Email" required='' />
					<input type="password" name="password" placeholder="Password" required='' />
					<button>Login</button>
				</form>
			</div>
	</div>
    </div>
  )
}

export default RegisterForm
